\set ECHO none

BEGIN TRANSACTION;

--- Drop everything to reset ---
DROP TABLE IF EXISTS WORKS CASCADE;
DROP TABLE IF EXISTS  ITEMS CASCADE;
DROP TABLE IF EXISTS  PATRONS CASCADE;
DROP TABLE IF EXISTS  EVENTS CASCADE;
DROP SEQUENCE IF EXISTS  ITEM_ID_SEQ;
-- n.b. Triggers cascade from tables

--- Create fresh versions of the tables ---
CREATE TABLE WORKS (
    isbn VARCHAR PRIMARY KEY, 
    cost INTEGER, 
    title VARCHAR);

CREATE TABLE ITEMS (
    item_id VARCHAR PRIMARY KEY, 
    isbn VARCHAR NOT NULL REFERENCES WORKS);

CREATE TABLE PATRONS (
    patron_id SERIAL PRIMARY KEY, 
    patron_name VARCHAR NOT NULL, 
    email_address VARCHAR, 
    dob DATE NOT NULL, 
    guardian INTEGER REFERENCES PATRONS);

CREATE TABLE EVENTS (
    event_id SERIAL PRIMARY KEY, 
    patron_id INTEGER NOT NULL REFERENCES PATRONS, 
    item_id VARCHAR NOT NULL REFERENCES ITEMS, 
    event_type VARCHAR NOT NULL, 
    time_stamp TIMESTAMP NOT NULL, 
    CHARGE INTEGER);







COMMIT;

\set ECHO all
--- Finished running setup script. --- 
